import "./App.css";
import { Button } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <h1>Demo McBrid</h1>
      <button>Simple Button</button>
      <Button>Bootstrap Button</Button>
    </div>
  );
}

export default App;
